import React from "react";
import Navbar from "./Navbar";
import Footer from "./Footer";
import devotee from "../images/devotee.jpeg";


export default function Login() {
  return (
    <div>
      <Navbar />
      <img
        className="rounded-full w-80 h-80 mt-20 mb-20 ml-20"
        src={devotee}
        alt="image description"/>
<button 
      className="rounded-full h-12 w-12 flex items-center justify-center bg-gray-400 text-white focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-gray-500"
      onClick={props.onClick}></button>
      <Footer />
    </div>
  )
}
